    "48800": {
        "Desc": "Find Charles and ask about his commission",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "Lisa? Are you here about the tax return?"
                },
                {
                    "N": "Lisa",
                    "T": "Oh, hello darling. You're quite right. After I heard about poor Jean, I thought I might lend a hand with some of her more literary duties."
                },
                {
                    "N": "_1005",
                    "T": "Cool, well if we're no longer needed here, we'll be on our way."
                },
                {
                    "N": "Lisa",
                    "T": "Oh wait a moment... Actually, Charles here was wondering—"
                },
                {
                    "N": "Charles",
                    "T": "Please, allow me, ma'am."
                },
                {
                    "N": "Charles",
                    "T": "I just took a rather important order, but unfortunately we've run completely dry and the delivery from the winery is behind schedule."
                },
                {
                    "N": "Charles",
                    "T": "If it's not too much trouble, could you go and <color=#00E1FFFF>do something about this logistical nuisance</color>?"
                },
                {
                    "N": "_1005",
                    "T": "What's so urgent about this order?"
                },
                {
                    "N": "Charles",
                    "T": "*sigh* It came in at the last minute. Literally, just a few seconds ago."
                },
                {
                    "N": "Lisa",
                    "T": "Exactly, hence the urgency."
                },
                {
                    "N": "_0",
                    "T": "Okay, I'll see what I can do."
                },
                {
                    "N": "_0",
                    "T": "Okay, but my next drink here had better be on the house!"
                },
                {
                    "N": "Charles",
                    "T": "Heh... I'm positive that next time my boss Master Diluc is here, he'll pick up the tab for you."
                },
                {
                    "N": "_1005",
                    "T": "Sounds about right!"
                }
            ]
        ]
    },
    "48801": {
        "Desc": "Talk to Ernest",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "So this is where Charles' delivery got to."
                },
                {
                    "N": "Ernest",
                    "T": "Have you come to rescue me? I've been waiting long enough."
                },
                {
                    "N": "Ernest",
                    "T": "In all the time I've been working at the winery, this is the first time I've been robbed by hilichurls. *sigh*"
                },
                {
                    "N": "Ernest",
                    "T": "If you'd taken any longer, I don't know what I would have done."
                },
                {
                    "N": "_1005",
                    "T": "#Fear not. {NICKNAME} here is a hilichurl exterminator extraordinaire!"
                },
                {
                    "N": "Ernest",
                    "T": "Just as well. Then... please escort this <color=#00E1FFFF>transporter</color> to the end of the road."
                },
                {
                    "N": "Ernest",
                    "T": "And be careful with it. Just beating up the hilichurls is the not the aim here. You'd better <color=#00E1FFFF>make sure the goods stay intact</color> because I certainly don't have the Mora to replace them."
                },
                {
                    "N": "Ernest",
                    "T": "I'll be waiting up ahead."
                }
            ]
        ]
    },
