    "48701": {
        "Desc": "Talk to Margaret",
        "Talk": [
            [
                {
                    "N": "Venti",
                    "T": "...So, yours is the cat that went missing."
                },
                {
                    "N": "_1005",
                    "T": "Venti! Have you come to help?"
                },
                {
                    "N": "Venti",
                    "T": "Me, here to help you? Why, on the contrary, it is I who needs helping!"
                },
                {
                    "N": "_1005",
                    "T": "But Paimon just saw you talking to Margaret about Prince..."
                },
                {
                    "N": "Venti",
                    "T": "Aha! So, Prince is the name of the feline fiend who thieved my spare <color=#00E1FFFF>astral iron strings</color>!"
                },
                {
                    "N": "Venti",
                    "T": "Though it gladdens my heart to see that the free-spirited ethos of Mondstadt is alive and well in creatures great and small... Still, it's a bit audacious!"
                },
                {
                    "N": "Margaret",
                    "T": "Haha, Prince is a mischievous little rascal alright!"
                },
                {
                    "N": "_0",
                    "T": "Spoken just like a parent who chooses to spoil said rascal!"
                },
                {
                    "N": "_1005",
                    "T": "Indeed. Just like Barbatos..."
                },
                {
                    "N": "Venti",
                    "T": "Ahaha, yes, quite... quite... Ahem! Now, let's see about getting ourselves an audience with his little highness, Prince Rascal of Mondstadt!"
                },
                {
                    "N": "Venti",
                    "T": "I have a performance tonight, and without my spare strings, I shall have to disappoint my audience."
                },
                {
                    "N": "_1005",
                    "T": "What would a kitty cat want with lyre strings anyway?"
                },
                {
                    "N": "Margaret",
                    "T": "Everyone knows cats go crazy for a ball of string!"
                },
                {
                    "N": "_1005",
                    "T": "What!?"
                },
                {
                    "N": "Venti",
                    "T": "These lyre strings are made of astral iron, which contains Anemo energy. That makes them extremely durable, so I normally just roll them up in a ball to make them easier to carry."
                },
                {
                    "N": "Venti",
                    "T": "That's a trick of the trade from a traveling bard!"
                },
                {
                    "N": "_1005",
                    "T": "The strings contain Anemo energy?"
                },
                {
                    "N": "_1005",
                    "T": "#That'll help us! {NICKNAME}, it's time for you to use your <color=#00E1FFFF>Elemental Sight</color> again!"
                }
            ]
        ]
    },
