    "48703": {
        "Desc": "Complete Margaret's commission",
        "Talk": [
            [
                {
                    "N": "Margaret",
                    "T": "Prince! Where did you go running off to? Thank goodness you're safe..."
                },
                {
                    "N": "_1005",
                    "T": "He made sure we had our work cut out for us looking for him."
                },
                {
                    "N": "Margaret",
                    "T": "Oh Princey, how could you leave me like that..."
                },
                {
                    "N": "_1005",
                    "T": "Looks like those two need some time to themselves..."
                },
                {
                    "N": "_1005",
                    "T": "And here are your astral iron strings, Venti."
                },
                {
                    "N": "Venti",
                    "T": "You found them! Wonderful! I was not optimistic they would turn up."
                },
                {
                    "N": "Venti",
                    "T": "I daresay that a private performance played using these very same strings would not be an excessive way to show my gratitude! ...Ah, ah..."
                },
                {
                    "N": "_1005",
                    "T": "Ah what?"
                },
                {
                    "N": "Venti",
                    "T": "ACHOO!"
                },
                {
                    "N": "Venti",
                    "T": "*cough* Haha... Apologies. At this distance, my cat allergy seems to be rearing its head..."
                },
                {
                    "N": "_1005",
                    "T": "Oh, now Paimon gets why you didn't go looking for your strings by yourself..."
                },
                {
                    "N": "Venti",
                    "T": "Hehe, anyway, thanks for the help, I'll be going now— a—achoo!"
                }
            ]
        ]
    },
