    "49001": {
        "Desc": "Ask Barbara about Jean's condition",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "Hi Barbara, we're back."
                },
                {
                    "N": "Barbara",
                    "T": "Welcome back. You must be exhausted."
                },
                {
                    "N": "_0",
                    "T": "How is Jean doing?"
                },
                {
                    "N": "_0",
                    "T": "I'm sure you must be exhausted, too."
                },
                {
                    "N": "Barbara",
                    "T": "Oh it's nothing, looking after patients is all in a day's work for me."
                },
                {
                    "N": "Barbara",
                    "T": "Jean has regained consciousness and should be back to her normal self soon enough."
                },
                {
                    "N": "_1005",
                    "T": "That's great news! Let's go and see her."
                },
                {
                    "N": "Barbara",
                    "T": "But she just left the Cathedral. I tried to tell her she needs more rest, but she wouldn't listen."
                },
                {
                    "N": "Barbara",
                    "T": "She tried to act like she was fine and kept saying she wanted to get some fresh air. I bet you she's gone to <color=#00E1FFFF>Lady Vennessa's place</color> again."
                },
                {
                    "N": "_1005",
                    "T": "Where?"
                },
                {
                    "N": "Barbara",
                    "T": "Oh, that <color=#00E1FFFF>huge tree at Windrise</color>. That place is dedicated to Mondstadt's hero, Vennessa."
                },
                {
                    "N": "Barbara",
                    "T": "Jean goes there whenever she feels lost and confused deep down inside."
                },
                {
                    "N": "_1005",
                    "T": "Barbara, that's some pretty personal stuff... How do you know so much about Jean's innermost thoughts?"
                },
                {
                    "N": "Barbara",
                    "T": "...Jean, uh, mentioned it to me, y'know, before she left."
                },
                {
                    "N": "_0",
                    "T": "Jean is still recovering, right?"
                },
                {
                    "N": "_0",
                    "T": "Will she be okay out there on her own, in her condition?"
                },
                {
                    "N": "Barbara",
                    "T": "That's what I'm worried about, too. But I still have work to do here..."
                },
                {
                    "N": "_1005",
                    "T": "Don't worry, we'll take over nursing duty for now."
                },
                {
                    "N": "Barbara",
                    "T": "Great! That puts my mind at rest. May the Anemo Archon protect you... and Jean."
                }
            ]
        ]
    },
    "49002": {
        "Desc": "Go to the big \"Symbol of Vennessa\" tree",
        "Talk": []
    },
    "49003": {
        "Desc": "Finish conversation",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "Hi Jean, are you feeling better now?"
                },
                {
                    "N": "Jean",
                    "T": "Much better. I was not expecting you to come here. Thank you for your concern."
                },
                {
                    "N": "_1005",
                    "T": "Are you sure? We saw you beneath the tree just now, leaning on your sword — it looked like you were struggling."
                },
                {
                    "N": "_1005",
                    "T": "Are you sure you aren't pushing yourself too hard?"
                },
                {
                    "N": "_0",
                    "T": "You can always rely on the other knights."
                },
                {
                    "N": "_0",
                    "T": "You can always rely on us."
                },
                {
                    "N": "Jean",
                    "T": "Oh... Thank you, that means a lot to me. Hearing that boosts my spirits."
                },
                {
                    "N": "Jean",
                    "T": "But I must find a way to cope with minor setbacks like this on my own. Otherwise, how can I be the protector that Mondstadt needs me to be? The protector that Vennessa was..."
                },
                {
                    "N": "_1005",
                    "T": "You truly revere Vennessa, huh?"
                },
                {
                    "N": "Jean",
                    "T": "I do. Vennessa was the first Grand Master, a kind yet formidable woman. I have always hoped to follow in her footsteps."
                },
                {
                    "N": "Jean",
                    "T": "As the Lionfang Knight, she courageously overthrew the oppressive ruling aristocracy of her time. Then, she founded the Knights of Favonius and became known as the Dandelion Knight, spreading grace and compassion throughout the land."
                },
                {
                    "N": "_1005",
                    "T": "Dandelion Knight — isn't that your title?"
                },
                {
                    "N": "Jean",
                    "T": "Hmm... Actually, all of the Knights of Favonius' Masters throughout the ages have inherited the title of \"Dandelion Knight\" or \"Lionfang Knight.\""
                },
                {
                    "N": "_1005",
                    "T": "Oooh, that makes sense now."
                },
                {
                    "N": "_1005",
                    "T": "You too want to be as gentle as the Dandelion Knight and yet as fierce as the Lionfang Knight?"
                },
                {
                    "N": "Jean",
                    "T": "Yes. I know it sounds like a huge honor, inheriting both these titles from Vennessa..."
                },
                {
                    "N": "Jean",
                    "T": "But I see it more as a huge responsibility."
                },
                {
                    "N": "Jean",
                    "T": "After all, it is a lot to live up to."
                },
                {
                    "N": "_0",
                    "T": "I could get used to Jean the Lionfang Knight..."
                },
                {
                    "N": "_0",
                    "T": "Actually, Dandelion Knight suits you better."
                },
                {
                    "N": "_1005",
                    "T": "Paimon thinks so too!"
                },
                {
                    "N": "Jean",
                    "T": "..."
                },
                {
                    "N": "_1005",
                    "T": "Jean?"
                },
                {
                    "N": "Jean",
                    "T": "Who's there?"
                }
            ]
        ]
    },
